import React from 'react';
import ReactDOM from 'react-dom';
import { BrowserRouter, Routes, Route } from "react-router-dom";
import './index.css';
import JudgeAuth from './pages/JudgeAuth.js';
import JudgeApp from './pages/JudgeApp.js';

import App from './pages/App';
import Edit from './pages/Edit';
import Share from './pages/Share';
import Music from './pages/App';
import { toneObject, toneTransport, gPart, fPart, pPart, dPart } from "./data/instruments.js";

ReactDOM.render(
  <React.StrictMode>
    <BrowserRouter>
            <Routes>
                <Route path="/" element={<App toneObject={toneObject} toneTransport={toneTransport} gPart={gPart} pPart={pPart} fPart={fPart} dPart={dPart}/>} />
                <Route path="/edit/:id" element={<Edit toneObject={toneObject} toneTransport={toneTransport}/>} />
                <Route path="/share/:id" element={<Share toneObject={toneObject} toneTransport={toneTransport} gPart={gPart} pPart={pPart} fPart={fPart} dPart={dPart}/>} />
            </Routes>
        </BrowserRouter>
  </React.StrictMode>,
  document.getElementById("root")
);
